import React, { Component } from 'react';

import test from '../../Home/test.png'



class Conhome extends Component {
    render() {
        return (
            <div class="background-origin: border-box;" >
                <img src = {test} alt="test" width="100%" height="100%"/>

            </div>
        )

    }
}
export default Conhome;
